	(11, 9, 'Rewards', 1, 26, '1', '1', 1, '0', 30, 'recycler_prizes', 'catalog_recycler_headline3', '', '', 'What are the prizes? Ecotron box may contain one of these:', '', '', '', '0', '', ''),
	(12, 9, 'Instruksjoner', 1, 42, '1', '1', 1, '0', 20, 'recycler_info', 'catalog_recycler_headline3', 'ctlg_ecotron_box', '', 'The Ecotron is a furni recycler. Get rid of old furni... what will you get in return? It\'s a surprise! Become a Habbo eco-warrior. No refunds!', 'How to use the Ecotron?', '1. Just drag 5 items from your hand to the Ecotron. One item / square. Recyclable items are marked in your inventory with an image. When you have 5 items in the boxes, click the "Recycle" button. You can now find the Ecotron prize box from your hand.\r\n\r\n2. Click the box to see its tag. Open the box, or trade it unopened. The timer shows you how long you have to wait before you can recycle more items. Check the prizes before you recycle- don\'t be surprised by the surprise!', '', '0', '', ''),
	(13, -1, 'Habin Banken', 11, 6, '1', '1', 1, '0', 11, 'default_3x3', 'catalog_bank_headline1', 'catalog_bank_teaser', 'catalog_special_txtbg1', 'You can exchange your Uber credits here for Exchange furniture, which you can use in a trade or simply exchange for actual credits.', '', 'Click on an item to see more details.', 'Gold! Glorious Gold!', '0', '', ''),
