INSERT INTO `moderation_presets` (`id`, `enabled`, `type`, `message`) VALUES
	(18, '1', 'message', 'You have scammed, so that will be a two (2) Hour ban. When you come back, please make it stop, or a further timed ban will come. -Staff'),
	(19, '1', 'message', 'You have been cyber bullying, you will get a two (2) Hours ban. When you come back, please make it stop. -Staff'),
	(20, '1', 'message', 'This specific feature(s)/furniture(s), as you have pointed out are on their way to Habbo.VG, the technical and coding team in Habbo are working on bringing this to Habbo.VG, please wait momentarily, this should take within 1-7 days, or up to a month. - Moderator/Admin on Duty.'),
	(22, '1', 'message', 'The Habbo.VG Staff Team is working on this problem. We are sorry for any inconvenience(s) this has caused. Please wait momentarily, - Moderators need to thoroughly deal with this properly. You should see changes being made soon. - Moderator/Staff on Duty.'),
	(23, '1', 'message', 'Your Call for Help has been processed and dealt with accordingly to the Habbo.VG Staff Code of Conduct, and the Moderation Team has taken your Call for help into consideration. This Call for Help has been recorded for confidential reasons. If this has not been dealt with to your satisfaction, please email us.'),
	(24, '1', 'message', 'You have been giving Personal Info / Phonenumbers / Adresses, so now you get a 2 Hour ban. If you keep doing this, we will ban even longer. -Staff'),
	(25, '1', 'message', 'If you have any technical problems, please email us at other.habbo.vg@gmail.com or alternatively contact a Staff online. -Staff'),
	(26, '1', 'message', 'The hourly credits are every 3 Hours. You get automatically 3.000c. For mroe Info, go on your Homepage -> Credits. -Staff'),
	(28, '1', 'message', 'Your behaviour/actions/language is highly inappropriate, and breaches the Habbo.VG Way, please comply with the Habbo.VG Way that we have distributed. You can view this by going to \'Community\' then, \'Habbo VG Way\', Please make the correct alternations so that punishments are not applied to you. - Hotel Management'),
	(29, '1', 'message', 'Your Call for Help does not meet the requirements made to be processed. Please be aware that the Call for Help tool is only used for genuine reasons, and it is preferably not misused. - Habbo.VG Moderation Team'),
	(30, '1', 'roommessage', 'Room has been marked as faggot ass licker, & Jacob DON\'T CHANGE MY SHIT. -Ryan'),
	(31, '0', 'message', 'Newly generated preset - please update');
